    return(
        <div>
            <NavbarPer idUser={idUser}></NavbarPer>
            <div>
            <PagGastos></PagGastos>
             </div>
             <div>
            <PagIngresos></PagIngresos>
             </div>
        </div>
    )
}
*/
export default PaginaPrincipal;
